import React from 'react';


const ApplyButton = () => {

  const apply = () => {
    (sessionStorage.getItem('state') === null) ?
    window.location.replace('/login/') :
    console.log('No');
  }


  return(
    <button onClick={apply()} ></button>
  );
};

export default ApplyButton;
